import React from "react";

const ShowTask = () => {
  return (
    <section className="showTask">
      <div className="head">
        <div>
          <span className="title">To Do</span>
          <span className="count">0</span>
        </div>

        <button className="clearAll" type="button">
          {" "}
          Clear ALL
        </button>
      </div>
    </section>
  );
};

export default ShowTask;
